import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import MainContainer from "./components/mainView/mainContainer.js";
import Header from "./components/headerContainer/Header.js";
import Card from "./components/mainView/Card.js";
import Cartelera from "./components/cartelera/Cartelera.js";
import Opinion from "./components/dejaTuOpinion/Opinion.js";
import Form from "./components/dejaTuOpinion/Form.js";
import FinalView from "./components/finalView/FinalView.js"

function App() {
  return (
    <Router>
      <div
        style={{
          display: "flex",
          alignItems: "center",
          flexDirection: "column",
        }}
      >
        <Header />
        <MainContainer>
          <Card></Card>
        </MainContainer>
        <Route path="/" exact component={Cartelera} />
        <Route path="/opinion" component={Opinion} />
        <Route path="/form" component={Form} /> {/* Agrega la ruta para el formulario */}
        <Route path="/final" component={FinalView} /> {/* Agrega la ruta para la vista final */}
      </div>
    </Router>
  );
}

export default App;
